import React, { useState } from "react";

export default function Drawer({ isOpen }) {
  const disp = isOpen === true ? "none" : "block";
  return (
    <div
      style={{
        display: disp,
        zIndex: "3",
        position: "absolute",
      }}
    >
      <div
        style={{
          width: "450px",
          height: "650px",
          backgroundColor: "red",
        }}
      >
        hello
      </div>
    </div>
  );
}
